        if(!$tenant) { return; }
        //Set DB Connection
        \DB::purge('tenant');
        $config = Config::get('database.connections.tenant');
        $config['database'] = $tenant->db;
        $config['username'] = $tenant->db_user;
        $config['password'] = decrypt($tenant->db_pw);
        config()->set('database.connections.tenant', $config);
        \DB::connection('tenant');

        foreach($visticle_localmage_artikel_variation_preis as $oldArticle) {

            $ean = $oldArticle['variation_identifier'];

            $var = Article_Variation::where('vstcl_identifier','=','vstcl-'.$ean)->first();
            if(!$var) { continue; }

            if($oldArticle['preis_name'] == 'standard') {
                $oldPrice = $var->prices()->where('name', '=', 'standard')->first();
            }
            elseif($oldArticle['preis_name'] == 'discount') {
                $oldPrice = $var->prices()->where('name', '=', 'discount')->first();
            }
            if(!$oldPrice) { continue; }

            $oldPrice = (float)str_replace(',','.', $oldPrice->value);

            switch($oldArticle['preis_operator']) {
                case '=':
                    $newPrice = (float)$oldArticle['preis_value'];
                break;
                case '+':
                    $newPrice = $oldPrice + (float)$oldArticle['preis_value'];
                break;
                case '-':
                    $newPrice = $oldPrice - (float)$oldArticle['preis_value'];
                break;
                case '/':
                    $newPrice = $oldPrice / (float)$oldArticle['preis_value'];
                break;
                case 'x':
                    $newPrice = $oldPrice * (float)$oldArticle['preis_value'];
                break;
                default:
                break;
            }

            if($oldArticle['preis_name'] == 'standard') {
                Article_Variation_Price::updateOrCreate(
                ['fk_article_variation_id' => $var->id,'name' => 'web_standard'],
                ['value' => str_replace('.',',', $newPrice)]);
            }
            elseif($oldArticle['preis_name'] == 'discount') {
                Article_Variation_Price::updateOrCreate(
                ['fk_article_variation_id' => $var->id,'name' => 'web_discount' ],
                ['value' => str_replace('.',',', $newPrice) ]);
            }

        }
